column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli प्रत्यक्ष JSON विन्यास आँकड़ा स्वीकार कर सकता है और विन्यास समाहित करने वाले फ़ाइल नाम. बाद की स्थिति में फ़ाइल फ़ाइल पढ़ा जाता है और सामग्री को इस गुण में डाला जाता है.

उदाहरण: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
प्रयोग: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
प्रयोग: nmcli general status { help }

NetworkManager का स्थिति दिखाएँ.
'status' तयशुदा क्रिया है, जिसका अर्थ है कि 'nmcli gen' 'nmcli gen status' को कॉल करता है

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
प्रयोग: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
प्रयोग: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

सभी रेडियो स्विच की स्थिति पाएँ, या उन्हें चालू/बंद करें.

